import "./MainPage.css";
import * as texts from "../../Utilities/textForApp";

const MainPage = () => {
  return (
    <div className="mainPage">
      <div className="dogImg"></div>
      <div className="content">
        <h2>{texts.MAIN_H2}</h2>
      </div>
    </div>
  );
};

export default MainPage;
